import React from 'react';
import './InteractiveTextAnimation.css';

const InteractiveTextAnimation = () => {
  return (
    <div className="main-content">
      {/* Concept One - Grid Hover */}
      <div className="concept concept-one">
        {Array.from({ length: 9 }, (_, i) => (
          <div key={i} className={`hover hover-${i + 1}`}></div>
        ))}
        <h1>Prince</h1>
      </div>

      {/* Concept Two - Scale on Hover */}
      <div className="concept concept-two">
        {['F', 'O', 'R', 'E', 'S', 'T'].map((letter, index) => (
          <div key={index} className="hover">
            <h1>{letter}</h1>
          </div>
        ))}
      </div>

      {/* Concept Three - Vertical Movement */}
      <div className="concept concept-three">
        <div className="word">
          {['C', 'A', 'N', 'Y', 'O', 'N'].map((letter, index) => (
            <div key={index} className="hover">
              <div></div>
              <div></div>
              <h1>{letter}</h1>
            </div>
          ))}
        </div>
      </div>

      {/* Concept Four - Letter Spacing */}
      <div className="concept concept-four">
        <h1>Glacier</h1>
      </div>

      {/* Concept Five - Alternating Movement */}
      <div className="concept concept-five">
        <h1 className="word">
          {['M', 'O', 'U', 'N', 'T', 'A', 'I', 'N', 'S'].map((letter, index) => (
            <span key={index} className="char">
              {letter}
            </span>
          ))}
        </h1>
      </div>

      {/* Concept Six - Individual Letter Animation */}
      <div className="concept concept-six">
        <h1 className="word">
          {['O', 'C', 'E', 'A', 'N'].map((letter, index) => (
            <span key={index} className="char">
              {letter}
            </span>
          ))}
        </h1>
      </div>

      {/* Concept Seven - Jump Out Animation */}
      <div className="concept concept-seven">
        <h1>fries</h1>
      </div>

      {/* Concept Eight - Falling Animation */}
      <div className="concept concept-eight">
        <h1 className="word">
          {['F', 'A', 'L', 'L', 'S'].map((letter, index) => (
            <div key={index} className="char" data-content={letter}>
              {letter}
            </div>
          ))}
        </h1>
      </div>

      {/* Footer */}
      <footer>
        <a href="https://twitter.com/meowlivia_" target="_blank" rel="noopener noreferrer">
          <i className="icon-social-twitter icons">🐦</i>
        </a>
        <a href="https://github.com/oliviale" target="_blank" rel="noopener noreferrer">
          <i className="icon-social-github icons">📚</i>
        </a>
        <a href="https://dribbble.com/oliviale" target="_blank" rel="noopener noreferrer">
          <i className="icon-social-dribbble icons">🏀</i>
        </a>
      </footer>
    </div>
  );
};

export default InteractiveTextAnimation;
